import{_ as a,p as r,q as i,R as o,a1 as t}from"./framework-5866ffd3.js";const c={},h=t('<h1 id="数据结构" tabindex="-1"><a class="header-anchor" href="#数据结构" aria-hidden="true">#</a> 数据结构</h1><blockquote><p>数据结构是一门很重要的课程，不论语言。</p></blockquote><h2 id="一些概念" tabindex="-1"><a class="header-anchor" href="#一些概念" aria-hidden="true">#</a> 一些概念</h2><blockquote><p>数据结构包括：<b>线性结构</b>和<b>非线性结构</b></p></blockquote><h3 id="线性结构" tabindex="-1"><a class="header-anchor" href="#线性结构" aria-hidden="true">#</a> 线性结构</h3><blockquote><ol><li>线性结构作为最常用的数据结构，其特点是数据元素之间存在一对一的线性关系</li><li>线性结构有两种不同的存储结构，即顺序存储结构(数组)和链式存储结构(链表)。顺序存储的线性表称为顺序 表，顺序表中的存储元素是连续的</li><li>链式存储的线性表称为链表，链表中的存储元素不一定是连续的，元素节点中存放数据元素以及相邻元素的地 址信息</li><li>线性结构常见的有：数组、队列、链表和栈</li></ol></blockquote><h3 id="非线性结构" tabindex="-1"><a class="header-anchor" href="#非线性结构" aria-hidden="true">#</a> 非线性结构</h3><blockquote><p>非线性结构包括：二维数组，多维数组，广义表，树结构，图结构</p></blockquote><h3 id="百度百科中的数据结构补充" tabindex="-1"><a class="header-anchor" href="#百度百科中的数据结构补充" aria-hidden="true">#</a> 百度百科中的数据结构补充</h3>',9),l=["src"];function d(e,n){return r(),i("div",null,[h,o("img",{src:e.$withBase("/img/0052.png")},null,8,l)])}const u=a(c,[["render",d],["__file","preview.html.vue"]]);export{u as default};
